import styled from "styled-components";

const List = styled.ul`
display: flex;
flex-direction: column;
gap: 24px;
margin-left: 0;
padding: 100px 64px ;
`;

const Button = styled.button`
border-radius: 200px;
border: 1px solid rgba(71, 84, 103, 0.20);
`;

export {List, Button}
